    "underway-meteorological-navigational-physical-and-time-series-data-collected-aboard-the-noaa-sha5b19",nt"isopen":
    false,nt"url": null,nt"notes": "NODC Accession 0137364 contains raw underway
    meteorological, navigational, physical and time series data logged by the Scientific
    Computer System (SCS) aboard NOAA Ship Hi'ialakai in the North Pacific Ocean from
    2015-10-14 to 2015-10-26. Office of Marine and Aviation Operations (OMAO) personnel
    aboard the ship submitted these data and associated metadata to NODC. In addition,
    NODC Accession 0137364 contains supplementary cruise-level metadata, which OMAO
    personnel logged in the Ship Daily Activity Log (SDAL). OMAO and NODC personnel
    developed the automated process to archive these data under the auspices of the
    NOAA Rolling Deck to Repository (NOAA R2R) program.",nt"license_title": null,nt"extras":
